function Storage:clearSlot(slot)
    CEF:emulate(([[window.executeEvent('event.inventory.playerInventory', `[{"action":2,"data":{"type":25,"items":[{"slot":%d}]}}]`);]]):format(slot), false);
    self.slots[slot] = nil;
end

function Storage:clearAll()
    for i = 0, STORAGE_MAX_SLOT do
        self:clearSlot(i);
    end
end

---@param item Item
function Storage:setItem(item)
    self:setItems({item});
end

local ITEM_DATA_TYPE_SET_STORAGE = 25;

---@param items Item[]
function Storage:setItems(items, type)
     local data = {
        action = 2,
        data = {
            type = 25,
            items = items
        }
    };
    CEF:emulate(([[window.executeEvent('event.inventory.playerInventory', `[%s]`);]]):format(encodeJson(data)), false);
    for _, item in ipairs(items) do
        self.slots[item.slot] = item;
    end
end

function Storage:convertConfigItemToItem(configItem)
    return {
        slot = configItem.slot[0],
        item = configItem.item[0],
        amount = configItem.amount[0],
        text = u8:decode(ffi.string(configItem.text)),
        background = configItem.background[0],
        enchant = configItem.enchant[0],
        color = configItem.color[0],
        strength = configItem.strength[0],
        available = configItem.available[0],
        blackout = configItem.blackout[0],
        time = configItem.time[0],
    };
end

